let rock = document.querySelector('.rock');
let paper = document.querySelector('.paper');
let scissor = document.querySelector('.scissor');
let player = document.querySelector('.player');
let but = document.querySelectorAll('.a');
let result = 0;
let nee = document.querySelector('.newGame');
let display = document.querySelector('.display');
alert('Start the game') * 1;
function rockImage() {
    player.style.backgroundImage = "url('data:image/png;base64,')";
    player.style.backgroundSize = 'cover';
    result = 1;
}
function paperImage() {
    player.style.backgroundImage = "url('https://media.geeksforgeeks.org/wp-content/uploads/20210705223645/paper.jpeg')";
    player.style.backgroundSize = 'cover';
    result = 2;
}
function scissorImage() {
    player.style.backgroundImage = "url('data:image/jpeg;base64,')";
    player.style.backgroundSize = 'cover';
    result = 3;
}
rock.addEventListener('click', rockImage);
paper.addEventListener('click', paperImage);
scissor.addEventListener('click', scissorImage);
let computer = document.querySelector('.computer');
let rand = 0;

function comp() {
    if (rand == 1) {
        computer.style.backgroundImage = "url('data:image/png;base64,')";
        computer.style.backgroundSize = 'cover';
    }
    else if (rand == 2) {
        computer.style.backgroundImage = "url('https://media.geeksforgeeks.org/wp-content/uploads/20210705223645/paper.jpeg')";
        computer.style.backgroundSize = 'cover';
    }
    else if (rand == 3) {
        computer.style.backgroundImage = "url('data:image/jpeg;base64,')";
        computer.style.backgroundSize = 'cover';
    }
    checkWinner();
}
but.forEach((i) => {
    rand = Math.floor((Math.random() * 3) + 1);
    console.log(rand);
    i.addEventListener('click', comp)
}
);
function checkWinner() {
    if (rand == result) {
        alert('You Won');
    }
    else {
        alert('You Lost');
    }
}
nee.addEventListener('click', () => {
    rand = Math.floor((Math.random() * 3) + 1);
    computer.style = null;
    player.style = null;
});